column8:
1992年に設立された「CARACTERE AUTOMOBILE」社は、本拠をベルギーに置きAUDI / VW / Porscheのエアロパーツの開発、生産、販売を行うと同時に、その高い生産技術とクオリティを世界各国から評価されおり、ヨーロッパチューナーからのOEM製造元としての実績も多数あるエアロパーツ専門メーカーです。<br><br>「CARACTERE AUTOMOBILE」社の長年のノウハウは取り付け説明書に証明されるように詳細に記載されております。これは車両フィッティングにベストマッチする証でもあるのです。「CARACTERE AUTOMOBILE」社が手掛けるAUDI / VW / Porscheのエアロパーツの特徴は、フルバンパータイプのパーツが大半である事です。自動車メーカーが目覚しい進化を遂げている今、個性豊かなドレスアップをお望みの方にご提案するフルバンパータイプエアロをお楽しみいただけると確信しています。<br><br>※未塗装品素材色　別途塗装が必要になりますのでご注意ください。※ご注文前に必ず適合確認をお願い致します。<br><br>対応車種：アウディ　A5スポーツバック　8T系<br><br>車検対応品<br><br>ボディパーツ | グリル<tr><td colspan="2">
